import React from "react";
import Frame from './frame.js'

class Frames extends React.Component {
    render() {
        // Проверяем, что this.props.frames является массивом
        if (!Array.isArray(this.props.frames)) {
            console.error('this.props.frames is not an array:', this.props.frames);
            return null; // Или возвращаем какой-то другой компонент или сообщение об ошибке
        }

        return (
            <div className="frames-container">
                {this.props.frames.map((frame) => (
                    <Frame 
                    key={frame.id} 
                    frame={frame} />
                ))}
            </div>
        );
    }
}

export default Frames;
